import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const img = require("../../../assets/hd.png")

const servOneData = [
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
]

const ServiceOneMiddle = () => {
    return (
        <View style={styles.l_middle}>
            <View style={styles.l_miidle_box}>
                <View style={styles.box}>
                    <Image source={img} style={styles.imgs} />
                </View>
                <View style={styles.box2}>One</View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    l_middle: {
        width: '100vw',
        height: '100vh',
        display: 'inline-block',
        top: 118
    }, l_miidle_box: {
        width: '100vw',
        backgroundColor: "#909090",
        margin: 'auto',
        flexDirection: 'row',
        justifyContent: 'space-between',
        // flexWrap: 'wrap',
        // padding: '20px'
    },
    box: {
        width: '120px',
        height: '200px',
        backgroundColor: "orange",
        margin: '4px',
    },
    box2: {
        width: '190px',
        height: '200px',
        backgroundColor: "#000",
        margin: '5px'
    },
    imgs: {
        width: 109,
        height: 116,
        left: 8,
        top: 5,

    }
})

export default ServiceOneMiddle;
